import React from "react";

const styles = {
    ranga: {
        fontFamily: "'Ranga', cursive"
    },
    texty: {
        fontFamily: "'Mansalva', cursive"
    },
}

function Title() {
    return (
        <div className="container">
            <div className="row">
                <div className="col-lg-1"></div>
                <div className="jumbotron w-100 mt-2 ">
                    <p className="text-center h1 bg-warning mb-3 p-2 rounded" style={styles.ranga}>Clicky Game</p>
                    <p className="text-center h3" style={styles.texty}>
                        Welcome to Ocean clicky. The memory game where you the user has to remember
                        which ocean creature images you have already clicked. To win click each image
                        only once, otherwise the game will start over.
                    </p>
                </div>
                <div className="col-lg-1"></div>
            </div>
        </div>
    );
}

export default Title;
